The inline javascript always evaluates to a value. If this value can be represented as text, it'll be embedded into your story. For example: {"This is inline javascript"}
{[1, 2, 3]}
{3.14}
{true}
{myValue = 1}
{myValue} Will show the following to the reader: This is inline javascript
1, 2, 3
3.14
true
1 By default all value assignment (=, +=, -=, etc.) will be hidden, even if it does evaluate to a value that can be represented as text.

12.body:
By default, block javascript will never embed anything into your story, unless you make it so by using the return keyword, or the document API to modify the DOM. ```js
const yourName = prompt("What's your name?");
return `Hello, ${yourName}`;
``` Will embed: Hello GoogleFeud!

