Your state will usually be saved in variables , which are persistent across paths. You can save pretty much anything. - Choose Ashley {chosen = "Ashley"}
- Choose Nick {chosen = "Nick"} {chosen}: Thank you for choosing me. After the user makes their choice, the chosen variable gets updated to either Ashley or Nick, and the character you chose says "Thank you for choosing me". Here are some other common uses: Code What it does variable = value Sets the variable to value. variable++ Increments the variable. So if it's currently 1, after the code is ran it will become 2. variable-- Decrements the variable. variable += n Adds n to the variable. variable -= n Subtracts n from the variable. variable.push(value) Adds a new value to the variable list. variable[key] = value Adds a new key-value pair to the variable table. Here's an example of using a list: - Kill Ashley {killed.push("Ashley")} You killed Ashley.
- Kill Nick {killed.push("Nick")} You killed Nick.

