Main paths (Those which are created with the # symbol) have to be unique - there can't be multiple paths with the same name, however, deviations can! So, let's say the reader is in another path, not Graveyard, but we want them to see the contents of the Left chapter, which is inside Graveyard. We can use a dot . to connect both names so Storytell knows where to find the Left path: -> Graveyard.Left
// or
-> graveyard.left
